        lrc: '[00:00.25]狐言 - 河图/洛天依\n[00:00.95]词：予词\n[00:01.05]曲：银临\n[00:01.15]编曲/混缩：灰原穷\n[00:01.38]调教：纳兰寻风\n[00:01.58]二胡：辰小弦\n[00:04.11]月心你可知\n[00:05.42]金陵城最近热闹啊\n[00:07.28]六扇门新招的捕快\n[00:09.01]是个红衣小姑娘\n[00:11.01]小姑娘做甚的捕快\n[00:12.87]打打杀杀成何体统\n[00:14.97]待本公子出手\n[00:16.78]救她浪子 回头\n[00:19.01]男：\n[00:20.38]昆仑有姑娘 策马似脱缰\n[00:23.46]十指无沾阳春水\n[00:25.84]却将长刀 扛\n[00:28.81]六扇门 打怪除妖多繁忙\n[00:31.92]不如与我做羹汤\n[00:34.25]红衣当配白裳\n[00:36.42]女：\n[00:37.34]柔肠百转\n[00:40.70]梦过三生娥眉赴侠肝义胆\n[00:46.42]破千帆\n[00:49.12]一望昆仑万山寒\n[00:52.27]合：\n[00:53.06]拨弦轻诉衷肠\n[00:55.10]回眸剑影刀光\n[00:57.26]一朝红杏泄春光\n[00:59.53]颦笑皆动荡\n[01:01.37]虎跃涧 强盗强\n[01:03.47]风入松 诗几行\n[01:05.82]夜太长\n[01:06.95]奈何刀锋有微芒\n[01:09.90]竹间檐下轻唱\n[01:11.92]杯间几番思量\n[01:14.03]今朝红衣战四方\n[01:16.41]夜醉又何妨\n[01:18.20]蛇影刀多狷狂\n[01:20.32]或南行或北望\n[01:22.61]三更响\n[01:23.82]独我月下还惆怅\n[01:28.92]冷月心\n[01:30.31]那小姑娘杀敌很猛啊\n[01:32.63]你行不行\n[01:34.37]过几日 再过几日 我定能\n[01:36.99]啊 这可你说的\n[01:39.83]君子一言 驷马难追\n[01:42.03]男：\n[01:44.59]昆仑有姑娘我日思夜想\n[01:47.64]媚香楼畔桃花醉\n[01:50.03]胡言要闯荡\n[01:53.00]折红梅 春过冬来平添香\n[01:56.14]白衣俊郎舞刀枪\n[01:58.59]万妖逃窜凄凉\n[02:00.66]女：\n[02:01.64]柔肠百转\n[02:04.82]梦过三生娥眉赴侠肝义胆\n[02:10.60]破千帆\n[02:13.29]一望昆仑万山寒\n[02:16.60]合：\n[02:17.15]拨弦轻诉衷肠\n[02:19.29]回眸剑影刀光\n[02:21.44]一朝红杏泄春光\n[02:23.73]颦笑皆动荡\n[02:25.61]虎跃涧强盗强\n[02:27.73]风入松诗几行\n[02:30.02]夜太长\n[02:31.16]奈何刀锋有微芒\n[02:34.06]竹间檐下轻唱\n[02:36.14]杯间几番思量\n[02:38.24]今朝红衣战四方\n[02:40.60]夜醉又何妨\n[02:42.44]蛇影刀多狷狂\n[02:44.55]或南行或北望\n[02:46.84]三更响\n[02:47.98]独我月下还惆怅\n[02:50.82]女：\n[02:52.21]柔肠百转\n[02:55.30]梦过三生娥眉赴侠肝义胆\n[03:01.10]破千帆\n[03:03.80]一望昆仑万山寒\n[03:07.12]合：\n[03:07.75]拨弦轻诉衷肠\n[03:09.80]回眸剑影刀光\n[03:11.95]一朝红杏泄春光\n[03:14.28]颦笑皆动荡\n[03:16.13]虎跃涧强盗强\n[03:18.25]风入松诗几行\n[03:20.47]夜太长\n[03:21.69]奈何刀锋有微芒'
